import React from 'react';

const HR = () => {
  return (
    <div>
      <h1 className="text-2xl font-semibold text-gray-900">HR Management</h1>
      <p className="mt-1 text-sm text-gray-500">Manage employees and human resources</p>
      <div className="mt-6 bg-white shadow rounded-lg p-6">
        <p className="text-gray-500">HR management interface coming soon...</p>
      </div>
    </div>
  );
};

export default HR;
